const Experience = () => {
    const boxRef = useRef(null);

    return(
        <>
        <ambientLight/>
        <directionalLight position={[10, 10, 5]}/>
        <OrbitControls makeDefault/>
            <mesh ref={boxRef}>
                <boxGeometry args={[1, 1, 1]} />
                <meshStandardMaterial color={"purple"} />
            </mesh>
        </>
    )
}

export default Experience;
